import React from 'react';

const Results = (props) => {
  return (
    <table>
      <tr>
        <th>id</th>
        <th>title</th>
        <th>vote</th>
      </tr>

      {props.results.map((result) =>  (
          <tr>
            <td>{result.id}</td>
            <td>{result.title}</td>
            <td>{result.vote_average}</td>
          </tr>
        ))
      }
    </table>
  );
};

export default Results;
